import React from "react";
import style from "./how.module.css";
import Link from "next/link";

const How = (props) => (
  <div>
    <section className={style.howSectio}>
      <div className={style.howContainer}>
        <div className={style.howImg}>
          <img src="/admin.png" />
        </div>
        <div className={style.howText}>
          <ul>
            <li></li>
          </ul>
        </div>
      </div>
    </section>
  </div>
);

export default How;
